import React from 'react';
import '../../styles/Footer.css';
import Derechos from '../../images/DerechosReservado.png';

    class Footer extends React.Component{
        render(){
            return(        
        <footer class="footer">
            <div class="icons-social">
                <ul class="list-social">

                    <li class="icons-social_item"><a class="icons-sociallink text-dark" href="/"><i class="icons-social_i fab fa-facebook"></i></a></li>
                    <li class="icons-social_item"><a class="icons-sociallink text-dark" href="/"><i class="icons-social_i fab fa-instagram"></i></a></li>
                    <li class="icons-social_item"><a class="icons-sociallink text-dark" href="/"><i class="icons-social_i fab fa-twitter"></i></a></li>

                </ul>
                <div class="container-footer">
            <p><img src={Derechos} className="Derechos" alt="/"/>Todos los derechos reservados</p>
        </div>
            </div> 
        </footer>
            )
        }
    }

    export default Footer;
